(126, 'Bien manger en 2025', 'Manger équilibré n\'a jamais été aussi crucial. Avec les nouveaux défis liés au rythme de vie moderne, il est important d\'adopter une alimentation riche en fibres, en protéines végétales et en bonnes graisses. Ce guide propose des exemples de menus, des as', 'Santé', '2025-04-02', 'Claire Martin', 2),
(127, 'Top 10 des destinations sportives', 'Envie de bouger tout en découvrant de nouveaux horizons ? Voici notre sélection des 10 meilleures destinations alliant sport et voyage : surf au Portugal, randonnée dans les Dolomites, escalade en Grèce, yoga à Bali… De quoi allier activité physique et pl', 'Voyage', '2025-04-05', 'Nadia B.', 3),
(128, 'L\'intelligence artificielle et le sport', 'L\'IA révolutionne le sport : analyse de performance, détection de blessures, personnalisation des entraînements... Ce dossier complet explique comment les capteurs, les algorithmes prédictifs et les applications intelligentes transforment l\'entraînement e', 'Technologie', '2025-04-08', 'Alan Turing', 4),
(129, 'Les bienfaits du yoga', 'Le yoga est bien plus qu\'une discipline physique. Il permet de travailler la souplesse, le tonus musculaire, mais aussi la concentration et la respiration. Adapté à tous les niveaux, il est reconnu pour ses effets sur la gestion du stress et l\'équilibre é', 'Santé', '2025-04-10', 'Marie Curie', 2),
(130, 'Cuisine sportive : recettes protéinées', 'Les protéines sont essentielles pour la récupération et la construction musculaire. Découvrez dans cet article 3 recettes savoureuses et riches en protéines : omelette aux légumes et fromage, bowl de quinoa au poulet, et smoothie aux fruits rouges et lait', 'Cuisine', '2025-04-12', 'Paul Bocuse', 5),
(131, 'Courir plus vite : le guide', 'Améliorer sa vitesse en course à pied nécessite de travailler à la fois la technique, la fréquence d\'entraînement et le mental. Ce guide détaillé aborde les phases d\'échauffement, les exercices de sprint, la récupération, et l\'importance de la régularité.', 'Sport', '2025-04-15', 'Usain Bolt', 6),
(132, 'Appli mobile pour suivre ses progrès', 'Le suivi de performance devient plus facile grâce aux applis mobiles. Du nombre de pas au rythme cardiaque, elles permettent de mieux comprendre son évolution. Dans cet article, nous comparons 5 applications fitness populaires, avec leurs avantages, incon', 'Technologie', '2025-04-17', 'Sophie Tech', 4);

